import React from 'react';

const GoogleLogin = ({ onSuccess }) => {
  const handleGoogleLogin = () => {
    // Use the Google Sign-In API or other library to obtain the googleToken
    const googleToken = 'YOUR_GOOGLE_TOKEN'; // Replace with the actual googleToken value

    // Pass the googleToken to the success handler
    onSuccess(googleToken);
  };

  return (
    <div>
      <button onClick={handleGoogleLogin}>Login with Google</button>
    </div>
  );
};

export default GoogleLogin;
